  function countLetters(string, index) {
    const letterCount = {};

    // Convert the string to lowercase to treat uppercase and lowercase letters as the same
    const lowercasedString = string.toLowerCase();

    // Iterate through each character in the string up to the specified index
    for (let i = 0; i <= index; i++) {

        // Skip non-alphabetic characters
        if (!character.match(/[a-z]/i)) {

        }

        letterCount[character] = 1;
        }
    }

    function romanToNum(roman) {
  const romanNumerals = {
    I: 1,
    V: 5,
    X: 10,
    L: 50,
    C: 100,
    D: 500,
    M: 1000
  };

  let result = 0;

  for (let i = 0; i < roman.length; i++) {
    const currentSymbol = roman[i];
    const currentValue = romanNumerals[currentSymbol];
    const nextValue = romanNumerals[roman[i + 1]];

    if (nextValue && currentValue < nextValue) {
      result -= currentValue;
    } else {
      result += currentValue;
    }
  }

  return result;
}
    async function doRomanStuff(text) {
      let romans = getRomans(text)
      let finalVal = 1;
      romans.forEach(num => 
         finalVal = finalVal * romanToNum(num)
      )
      document.getElementById("sum").innerText = ' Roman Numerals: '+romans.join(" ")+'\nMutiplied Value: '+finalVal;

    }
    
    function getRomans(str) {
  const romanLetters = ['I', 'V', 'X', 'L', 'C', 'D', 'M'];
  let currentGroup = '';
  const groups = [];

  for (let i = 0; i < str.length; i++) {
    const currentChar = str[i];

    if (romanLetters.includes(currentChar)) {
      if (currentGroup === '') {
        currentGroup = currentChar;
      } else {
        currentGroup += currentChar;
      }
    } else {
      if (currentGroup !== '') {
        groups.push(currentGroup);
        currentGroup = '';
      }
    }
  }

  if (currentGroup !== '') {
    groups.push(currentGroup);
  }

  return groups;
}

function parseData(data) {
  const jsonData = {};
  let minutes;

  const lines = data.split("\n");
  lines.forEach((line) => {
    const words = line.trim().split(" ");
    if (words.length === 2 && words[1] === "minutes") {
      minutes = words[0];
      jsonData[minutes] = [];
    } else {
      const minuteSeconds = words[0];
      const values = words.slice(1);
      jsonData[minutes].push({ [minuteSeconds]: values });
    }
  });

  return jsonData;
}

async function copyFormattedStr(string) {
  const div = document.getElementById("lots");
  const inputString = string.split("......")[1] || string;

  function isVowel(character) {
    const vowels = ['a', 'e', 'i', 'o', 'u', 'y', 'A', 'E', 'I', 'O', 'U', 'Y'];
    return vowels.includes(character);
  }

  function isRoman(character) {
    const romanNumerals = ['X', 'V', 'L', 'M', 'D', 'C', 'I'];
    return romanNumerals.includes(character);
  }

  function isNum(character){
    return /^\d+$/.test(character);
  }

  function isWing(character){
    const pattern = /[üêîüêõüåïüåëüåìüåîüåïüåíüåñüåóüåòüèãÔ∏è‚Äç‚ôÇÔ∏è]/;
    return pattern.test(character);
    }

  function countLetters(string, index) {
    const letterCount = {};

    // Convert the string to lowercase to treat uppercase and lowercase letters as the same
    const lowercasedString = string.toLowerCase();

    // Iterate through each character in the string up to the specified index
    for (let i = 0; i <= index; i++) {
        const character = lowercasedString.charAt(i);

        // Skip non-alphabetic characters
        if (!character.match(/[a-z]/i)) {
        continue;
        }

        // If the letter is already in the letterCount object, increment its count
        if (letterCount.hasOwnProperty(character)) {
        letterCount[character]++;
        }
        // Otherwise, initialize its count to 1
        else {
        letterCount[character] = 1;
        }
    }

    return letterCount;
  }



  function wrapCharacterWithSpan(character, fontSize, fontFamily) {
    console.log(character, fontSize, fontFamily)
    const span = document.createElement("span");
    span.style.fontSize = fontSize + "px";
    span.style.fontFamily = fontFamily;

  let fontSizeIndex = 0;

  htmlString += `<span style="font-family: Wingdings; font-size: 28px"><em>ü•öüêõüêõüêõüêõüêõüêõüêõüêõüåïüåëüåìüåîüåïüåíüåñüåóüåòüèãÔ∏è‚Äç‚ôÇÔ∏èüèãÔ∏è‚Äç‚ôÇÔ∏èüèãÔ∏è‚Äç‚ôÇÔ∏è......</em></span>`
  }

  for (let i = 0; i < inputString.length; i++) {

    // console.log(character)
    if(isNum(character)){
        const size = parseInt(character);
        htmlString += wrapCharacterWithSpan(character, size * size, "Monospace").outerHTML;
    } else{
        if (isRoman(character)) {

        htmlString += wrapCharacterWithSpan(character, goodSizes[goodSizes.length-indexObj[character.toLowerCase()]], "Times New Roman").outerHTML;

        let indexObj = countLetters(inputString, i)
        htmlString += wrapCharacterWithSpan("<strong>"+character+"</strong>", goodSizes[goodSizes.length-indexObj[character.toLowerCase()]], "Monospace").outerHTML;

        htmlString += wrapCharacterWithSpan(character, goodSizes[goodSizes.length-indexObj[character.toLowerCase()]], "Monospace").outerHTML;
        }
    }
  }

  div.innerHTML = htmlString;
